style.css:
@-moz-document domain("www.vagrantup.com") {
body {
	background-color: #2D2D2D !important;
	color: #4A7099;
}
h1,
h2,
h3,
h4,
h5,
h6 {
	color: #FF8100 !important;
}
#header {
	background-color: #3C3C3C !important;
}
#docs-sidebar ul.nav.docs-sidenav li a,
p a {
	color: #8DBB6E !important;
}
#docs-sidebar ul.nav.docs-sidenav li.active > a {
	color: #DC616A !important;
	font-weight: bold;
}
p,
li a {
	font-size: 1.2em !important;
}
code:first-child,
div > code {
	background-color: #3C3C3C !important;
}
code {
	color: #FF8100 !important;
}
pre {
	background-color: #3C3C3C !important;
}
.alert-warning {
	background-color: #3C3C3C !important;
	border-color: #CE0F0C !important;
}
}
